INSERT INTO `reg_subjects` VALUES (1,'Русский язык',7,1,'',37,431,431),(2,'Математика',6,2,'',25,2592,432),(3,'Иностранный язык',2,1,'',21,430,430),(4,'Физика',8,3,'',37,2593,2581),(5,'История',4,7,'',33,982,982),(6,'Литература',0,18,'',0,0,0),(7,'Обществознание',4,12,'',40,654,654),(8,'Информатика и ИКТ',6,5,'В экзаменационных заданиях используются следующие соглашения:\r\n<OL>\r\n<LI>Обозначения для логических связок (операций):\r\n<OL type=\"a\">\r\n<LI>отрицание (инверсия, логическое НЕ) обозначается $$\\neg$$ \r\n(например, $$\\neg$$А);\r\n<LI>конъюнкция (логическое умножение, логическое И) обозначается $$\\land$$ \r\n(например, А $$\\land$$ В) либо & (например, А & В);\r\n<LI>дизъюнкция (логическое сложение, логическое ИЛИ) обозначается $$\\lor$$ \r\n(например, А $$\\lor$$ В) либо | (например, А | В);\r\n<LI>следование (импликация) обозначается –> (например, А –> В);\r\n<LI>символ 1 используется для обозначения истины (истинного высказывания); символ 0 – для обозначения лжи (ложного высказывания).\r\n</OL></LI>\r\n<LI>Два логических выражения, содержащих переменные, называются равносильными (эквивалентными), если значения этих выражений совпадают при любых значениях переменных. Так, выражения А –> В и ($$\\neg$$А) $$\\lor$$ В равносильны, а А $$\\lor$$ В и А /\\ В – нет (значения выражений разные, например, при А = 1, В = 0).\r\n</LI>\r\n<LI>Приоритеты логических операций: инверсия (отрицание), конъюнкция (логическое умножение), дизъюнкция (логическое сложение), импликация (следование), эквивалентность (равносильность). Таким образом, $$\\neg$$А /\\ В $$\\lor$$ С /\\ D совпадает с (($$\\neg$$А) /\\ В) \\/ (С /\\ D). Возможна запись А /\\ В /\\ С вместо (А /\\ В) /\\ С. То же относится и к дизъюнкции: возможна запись А $$\\lor$$ В $$\\lor$$ С вместо (А $$\\lor$$ В) $$\\lor$$ С.\r\n',41,579,579),(9,'География',0,NULL,'',35,0,0);
