ldn’t help ____ when he told us what had happened.',1),(134,3,4,'We ____ the newspapers and the magazines every day about eight o’clock in the morning.',1),(135,3,4,'Has it stopped _______?',1),(136,3,4,'Gemma looked ______ lonely.',1),(137,3,4,'The crane ____ the car out of the lake.',1),(138,3,4,'Helen is leaving Chicago ______.',1),(139,3,5,'Travelling by train is ____ flying.',1),(140,3,5,'The policeman read gentleman his rights after he ____ him.',1),(141,3,5,'You must ______.',1),(142,3,5,'We expect the booklet ____ in print soon.',1),(143,3,5,'Her new book will probably ___ into a number of foreign languages.',1),(144,3,5,'My bicycle isn’t here any more. Somebody _______ it.',1),(145,3,5,'Who is the _____ of the car?',1),(146,3,5,'Let’s ____ our glasses to your health!',1),(147,3,5,'I disagree with you ____ every point.',1),(148,3,5,'It was evident he was furious from the way he ____ at his visitor.',1),(500,8,3,'Дано $$A=C9_{16}$$ и $$B=334_{8}$$. Какое из чисел С записанных в двоичной системе отвечает условиям $$A<C<B$$',1),(501,8,3,'Азбука Морзе позволяет кодировать символы для радиосвязи, задавая комбинацию точек и тире. Сколько различных символов (цифр, букв, знаков пунктуации и т.д.) можно закодировать, используя код Морзе длиной не менее пяти и не более шести сигналов (точек и тире)?',1),(502,8,3,'Считая, что каждый символ кодируется двумя байтами, оцените информационный объем следующего предложения в кодировке Unicode, содержащего 32 символа: <B>«Один пуд – около 16,4 килограмм.»<B>',1),(503,8,3,'Вычислите сумму чисел x и y, при $$x = 1D_{16}$$, $$y = 72_8$$. \r\nРезультат представьте в двоичной системе счисления.',1),(504,8,3,'Определите значение целочисленных переменных a и b после выполнения фрагмента программы:\r\n<TABLE border=1>\r\n<TR><TD>Бейсик</TD><TD>Паскаль</TD><TD>Алгоритмический</TD></TR>\r\n<TR><TD>a=2468<BR>\r\nb=(a MOD 1000)*10<BR>\r\na=a\\1000+b<BR>\r\n\'\\ и MOD — операции, вычисляющие результат деления нацело первого аргумента на второй и остаток от деления соответственно</TD>\r\n<TD>a:=2468;<BR>\r\nb:=(a mod 1000)*10;<BR>\r\na:=a div 1000+b;<BR>\r\n{div и mod — операции, вычисляющие результат деления нацело первого аргумента на второй и остаток от деления соответственно}</TD>\r\n<TD>a:=2468<BR>\r\nb:=mod(a, 1000)*10<BR>\r\na:=div(a, 1000)+b<BR>\r\n|div и mod — функции, вычисляющие результат деления нацело первого аргумента на второй и остаток от деления соответственно|</TD></TR></TABLE>',1),(505,8,3,'Для какого из указанных значений числа X истинно высказывание: <BR>\r\n$$(X>4) \\lor \\left((X>1) \\rightarrow (X>4)\\right)$$?',1),(506,8,3,'Значения двумерного массива размера 7х7 задаются с помощью вложенного оператора цикла в представленном фрагменте программы\r\n<TABLE border=1><TR><TD>Бейсик</TD><TD>Паскаль</TD><TD>Алгоритмический</TD></TR><TR><TD>\r\nFOR n=1 TO 7<BR>\r\nFOR k=1 TO 7<BR>\r\nB(n, k)=k–n<BR>\r\nNEXT k<BR>\r\nNEXT n</TD>\r\n<TD>for n:=1 to 7 do<BR>\r\nfor k:=1 to 7 do<BR>\r\n   B[n, k]:=k–n;</TD>\r\n<TD>нц для n от 1 до 7<BR>\r\nнц для k от 1 до 7<BR>\r\n   B[n, k]=k–n<BR>\r\nкц<BR>\r\nкц</TD></TR></TABLE>\r\nСколько элементов массива будут иметь положительные значения?\r\n',1),(507,8,3,'Какое логическое выражение равносильно выражению $$\\neg \\left(\\neg A \\lor B) \\lor \\neg C$$?',1),(508,8,3,'Символом F обозначено одно из указанных ниже логических выражений от трех аргументов: X, Y, Z.\r\nДан фрагмент таблицы истинности выражения F:\r\n<TABLE border=1>\r\n<TR>\r\n<TD>X</TD>\r\n<TD>Y</TD>\r\n<TD>Z</TD>\r\n<TD>F</TD></TR>\r\n<TR><TD>0</TD>\r\n<TD>0</TD>\r\n<TD>0</TD>\r\n<TD>0</TD></TR>\r\n<TR><TD>1</TD>\r\n<TD>1</TD><TD>0</TD><TD>1</TD></TR>\r\n<TR><TD>1</TD><TD>0</TD><TD>0</TD><TD>1</TD></TR></TABLE>\r\n\r\nКакое выражение соответствует F?\r\n',1),(509,8,3,'Для составления цепочек используются бусины, помеченные буквами: M, N, O, P, S.  В середине цепочки стоит одна из бусин M, O, S. На третьем – любая гласная, если первая буква согласная, и любая согласная, если первая гласная. На первом месте – одна из бусин O, P, S, не стоящая в цепочке в середине.\r\nКакая из перечисленных цепочек создана по этому правилу?',1),(510,8,3,'В таблице приведена стоимость перевозок между соседними железнодорожными станциями. Укажите схему, соответствующую таблице.\r\n<TABLE border=1>\r\n<TR><TD></TD><TD>A</TD><TD>B</TD><TD>C</TD><TD>D</TD><TD>Е</TD></TR>\r\n\r\n<TR><TD>A</TD><TD BGCOLOR=\"#bbbbbb\"></TD><TD>1</TD><TD>4</TD><TD></TD><TD>1</TD></TR>\r\n\r\n<TR><TD>B</TD><TD>1</TD><TD BGCOLOR=\"#bbbbbb\"></TD><TD></TD><TD>3</TD><TD></TD></TR>\r\n\r\n<TR><TD>C</TD><TD>4</TD><TD></TD><TD BGCOLOR=\"#bbbbbb\"></TD><TD></TD><TD>2</TD></TR>\r\n\r\n<TR><TD>D</TD><TD></TD><TD>3</TD><TD></TD><TD BGCOLOR=\"#bbbbbb\"></TD><TD></TD></TR>\r\n\r\n<TR><TD>Е</TD><TD>1</TD><TD></TD><TD>2</TD><TD></TD><TD BGCOLOR=\"#bbbbbb\"></TD></TR>\r\n</TABLE>',1),(511,8,3,'Для 5 букв русского алфавита заданы их двоичные коды (для некоторых букв   из двух бит, для некоторых – из трех). Эти  коды представлены в таблице:\r\n\r\n<TABLE border=1>\r\n<TR><TD>В</TD><TD>К</TD><TD>А</TD><TD>Р</TD><TD>Д</TD></TR>\r\n<TR><TD>000</TD><TD>11</TD><TD>01</TD><TD>001</TD><TD>10</TD></TR>\r\n</TABLE>\r\nИз четырех  полученных сообщений в этой кодировке, только одно прошло без ошибки и может быть корректно декодировано. Найдите его:\r\n',1),(512,8,3,'При работе с электронной таблицей в ячейке A1 записана формула \r\n= D1-$D2. Какой вид приобретет формула, после того как ячейку A1 скопируют в ячейку B1?\r\n<BR><I>Примечание: символ $ в формуле обозначает абсолютную адресацию.</I>',1),(513,8,3,'В некотором каталоге хранился файл <B>Дневник.txt</B>. После того, как в этом каталоге создали подкаталог и переместили в созданный подкаталог файл <B>Дневник.txt</B>, полное имя файла стало \r\n<B>A:\\SCHOOL\\USER\\TXT\\MAY\\Дневник.txt</B>. \r\n<BR>Каково полное имя каталога, в котором хранился файл до перемещения?',1),(514,8,3,'Ниже в табличной форме представлен фрагмент базы данных о результатах тестирования учащихся (используется стобалльная шкала):\r\n\r\n<TABLE border=1 class=\\\"test\\\">\r\n<TR><TD>Фамилия</TD><TD>Пол</TD><TD>Математика</TD><TD>Русский язык</TD><TD>Химия</TD><TD>Информатика</TD><TD>Биология</TR></TR>\r\n<TR><TD>Аганян</TD><TD>ж</TD><TD>82</TD><TD>56</TD><TD>46</TD><TD>32</TD><TD>70</TD></TR>\r\n<TR><TD>Воронин</TD><TD>м</TD><TD>43</TD><TD>62</TD><TD>45</TD><TD>74</TD><TD>23</TD></TR>\r\n<TR><TD>Григорчук</TD><TD>м</TD><TD>54</TD><TD>74</TD><TD>68</TD><TD>75</TD><TD>83</TD></TR>\r\n<TR><TD>Роднина</TD><TD>ж</TD><TD>71</TD><TD>63</TD><TD>56</TD><TD>82</TD><TD>79</TD></TR>\r\n<TR><TD>Сергеенко</TD><TD>ж</TD><TD>33</TD><TD>25</TD><TD>74</TD><TD>38</TD><TD>46</TD></TR>\r\n<TR><TD>Черепанова</TD><TD>ж</TD><TD>18</TD><TD>92</TD><TD>83</TD><TD>28</TD><TD>61</TD></TR></TABLE>\r\nСколько записей в данном фрагменте удовлетворяют условию\r\n«Пол=’м’ ИЛИ Химия>Биология»?\r\n',1),(515,8,3,'Дан фрагмент электронной таблицы:\r\n<TABLE border=1 class=\\\"test\\\">\r\n<TR><TD></TD><TD>А</TD><TD>В</TD></TR>\r\n<TR><TD>1</TD><TD>=B1+1</TD><TD>1</TD></TR>\r\n<TR><TD>2</TD><TD>=A1+2</TD><TD>2</TD></TR>\r\n<TR><TD>3</TD><TD>=B2–1</TD><TD></TD></TR>\r\n<TR><TD>4</TD><TD>=A3</TD><TD></TD></TR></TABLE>\r\nПосле выполнения вычислений, была построена диаграмма  по значениям диапазона ячеек A1:A4. Укажите получившуюся диаграмму.\r\n',1),(516,8,3,'Исполнитель Черепашка перемещается на экране компьютера, оставляя след в виде линии. В каждый конкретный момент известно положение исполнителя и направление его движения. У исполнителя существуют две команды:<BR>\r\n<B>Вперед <I>n</I></B>, вызывающая передвижение Черепашки на <I>n</I> шагов в направлении движения.<BR>\r\n<B>Направо <I>m</I></B>, вызывающая изменение направления движения на m градусов по часовой стрелке.    (Вместо  <I>n</I>  и  <I>m</I>  должны стоять целые числа).\r\nЗапись:<BR>\r\n<B>Повтори 5 [Команда1 Команда2]</B>\r\nозначает, что последовательность команд в квадратных скобках повторится 5 раз.\r\nКакое число необходимо записать вместо <I>n</I> в следующем алгоритме:\r\n<B>Повтори 7 [Вперед 40 Направо <I>n</I>]</B>,\r\nчтобы на экране появился правильный шестиугольник?\r\n',1),(517,8,3,'Укажите минимальный объем памяти (в килобайтах), достаточный для хранения любого растрового изображения размером 64x64 пикселя, если известно, что в изображении используется палитра из 256 цветов. Саму палитру хранить не нужно.',1),(518,8,3,'В системе счисления с некоторым основанием число 17 записывается в виде 101. Укажите это основание.',3),(519,8,3,'Определите значение переменной с после выполнения фрагмента алгоритма:\r\n<DIV style=\"width:100%; text-align:center; padding: 10px\">[tex]\\tikzstyle{block} = [draw, fill=blue!20, rectangle, \r\n    minimum height=3em, minimum width=6em,text width=5em, text centered]\r\n\\tikzstyle{output} = [coordinate]\r\n\\tikzstyle{ifblock} = [draw, fill=blue!20, diamond, \r\n    minimum height=3em, minimum width=6em]\r\n\r\n\r\n\\begin{tikzpicture}[auto, node distance=2cm,>=latex\']\r\n    \\node [block] (start) {b:=0\\\\\r\nc:=0};\r\n    \\node [ifblock, below of=start] (system) {b=11};\r\n    \\node [block, below of=system] (calc) {c:=c+b\\\\\r\nb:=b+1};\r\n\r\n    \\draw [->] (system) -- node[name=u, near start] {$нет$} (calc);\r\n    \\node [output, right of=calc] (output) {};\r\n    \\node [output, below of=output, node distance=1cm] (output2) {};\r\n\\node [output, left of=output2] (output3) {};\r\n\\node [output, left of=output3] (output4) {};\r\n \r\n    \\draw [->] (start) -- node[name=ue] {} (system);\r\n    \\draw [->] (system) -| node[name=d, near start] {$да$} (output2);\r\n\r\n\\draw [-] (calc) |- (output4);\r\n\\draw [->] (output4) |- (ue);\r\n\r\n\\end{tikzpicture}[/tex]</DIV>\r\nПримечание: знаком := обозначена операция присваивания.',3),(520,8,3,'Количество значащих нулей в двоичной записи десятичного числа 126 равно',3),(521,8,3,'Укажите значения логических переменных K, L, M, N, при которых логическое выражение [tex]\\left(K \\lor M\\right)\\rightarrow\\left(M \\lor  \\neg L \\lor N\\right)[/tex] <I>ложно</I>.\r\nОтвет запишите в виде строки из четырех символов: значений переменных K, L, M и N (в указанном порядке). Так, например, строка 0101 соответствует тому, что K=0, L=1, M=0, N=1. \r\n',3),(522,8,3,'Исполнитель Робот действует на клетчатой доске, между соседними клетками которой могут стоять стены. Робот передвигается по клеткам доски  и может выполнять команды 1 (вверх), 2 (вниз), 3 (вправо), 4 (влево), переходя на соседнюю клетку в направлении, указанном в скобках. Если в этом направлении между клетками стоит стена, то Робот разрушается. Робот успешно выполнил программу\r\n<I>3233241</I>.\r\nКакую последовательность из трех команд должен выполнить Робот, чтобы вернуться в ту клетку, где он был перед началом выполнения программы, и не разрушиться вне зависимости от того, какие стены стоят на поле?\r\n',3),(523,8,3,'Три школьника, Миша (М), Коля (К) и Сергей (С), остававшиеся в классе на перемене, были вызваны к директору по поводу разбитого в это время окна в кабинете. На вопрос директора о том, кто это сделал, мальчики ответили следующее:\r\nМиша: «Я не бил окно, и Коля тоже…»\r\nКоля: «Миша не разбивал окно, это Сергей разбил футбольным мячом!»\r\nСергей: «Я не делал этого, стекло разбил Миша». \r\nСтало известно, что один из ребят сказал чистую правду, второй в одной части заявления соврал, а другое его высказывание истинно, а третий оба факта исказил. Зная это, директор смог докопаться до истины.\r\nКто разбил стекло в классе? В ответе запишите только первую букву имени. ',3),(524,8,3,'Модему, передающему сообщения со скоростью 28 800 бит/сек., для передачи 100 страниц текста в 30 строк по 60 символов каждая в кодировке ASCII потребуется     ______секунд(-ы).',3),(525,8,3,'Цепочки символов (строки) создаются по следующему правилу.\r\nПервая строка состоит из одного символа – цифры «1». \r\nКаждая из последующих цепочек создается такими действиями: в очередную строку дважды записывается цепочка цифр из предыдущей строки (одна за другой, подряд), а в конец приписывается еще одно число – номер строки по порядку (на i-м шаге дописывается число «i»).\r\nВот первые 4 строки, созданные по этому правилу:\r\n<TABLE border=0><TBODY style=\"border: none;\">\r\n<TR><TD>(1)</TD><TD>1</TD></TR>\r\n<TR><TD>(2)</TD><TD>112</TD></TR>\r\n<TR><TD>(3)</TD><TD>1121123</TD></TR>\r\n<TR><TD>(4)</TD><TD>112112311211234</TD></TR></TBODY></TABLE>\r\n\r\nКакая цифра стоит в седьмой строке на 120-м месте (считая слева направо)? \r\n',3),(526,8,3,'Доступ к файлу www.txt, находящемуся на сервере ftp.net, осуществляется по протоколу http. В таблице фрагменты адреса файла закодированы буквами от А  до Ж. Запишите последовательность этих букв, кодирующую адрес указанного файла.\r\n<TABLE border=1>\r\n<TR><TD>A</TD><TD>.txt</TD></TR>\r\n<TR><TD>Б</TD><TD>http</TD></TR>\r\n<TR><TD>В</TD><TD>/</TD></TR>\r\n<TR><TD>Г</TD><TD>://</TD></TR>\r\n<TR><TD>Д</TD><TD>.net</TD></TR>\r\n<TR><TD>Е</TD><TD>www</TD></TR>\r\n<TR><TD>Ж</TD><TD>ftp</TD></TR></TABLE>\r\n',3),(527,8,3,'В таблице приведены запросы к поисковому серверу. Расположите обозначения запросов в порядке возрастания количества страниц, которые найдет поисковый сервер по  каждому запросу. \r\nДля обозначения логической операции “ИЛИ” в запросе используется символ |, а для логической операции “И” – символ &.\r\n<TABLE border=1>\r\n<TR><TD>А</TD><TD>разведение & содержание & меченосцы & сомики</TD></TR>\r\n<TR><TD>Б</TD><TD>содержание & меченосцы</TD></TR>\r\n<TR><TD>В</TD><TD>(содержание & меченосцы) | сомики</TD></TR>\r\n<TR><TD>Г</TD><TD>содержание & меченосцы & сомики</TD></TR>\r\n</TABLE>\r\n',3);
